import { Component } from '@angular/core';
import { Traveller } from 'src/app/models/traveller.model';

@Component({
  selector: 'app-travellers-list',
  templateUrl: './travellers-list.component.html',
  styleUrls: ['./travellers-list.component.css']
})
export class TravellersListComponent {
  travellers: Traveller[] = [
    {
      id: '000-000-0000-0001',
      name: 'Venancio Gomani',
      email: 'info@venanciogomani.net',
      phone: 810292775,
      destinations: [
        'Toronto',
        'San Antonio',
        'Leeds',
        'Berlin',
        'Lund'
      ]
    },
    {
      id: '000-000-0000-0002',
      name: 'Amelia',
      email: 'amelia@venanciogomani.net',
      phone: 766935959,
      destinations: [
        'Cape Town',
        'Livingstone',
        'Okavango',
        'Rio De Jenario'
      ]
    },
    {
      id: '000-000-0000-0002',
      name: 'Jasmine',
      email: 'jas@venanciogomani.net',
      phone: 766935959,
      destinations: [
        'Sydney',
        'Monte Carlo',
        'Munich',
        'Barcelona'
      ]
    }
  ];
  constructor() {}

  ngOnInit(): void {
    //
  }
}
